//componenets
import Logo from "../components/Logo";
import Login from "../components/Login";

const LoginSign = (props) => {
  return (
    <>
      <div id="loginSign" style={{ display: props.show === true ? "block" : "none" }}>
        <Login show={true} />
      </div>
    </>
  );
};

export default LoginSign;
